import axios from 'axios';
const API_URL = 'http://localhost:8181';
export class APIService{

    constructor(){

        
    }

    getContact(jenis) {
        const url = `${API_URL}/deskreview/${jenis}`;
        return axios.get(url).then(response => response.data);
    }

}
